import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import Search from './Search';

class Header extends Component {
    state={
        getSearchData : []
    }

    searchData=(data)=>{

        this.setState({getSearchData : data});

    }

    render() {
        return (
            <header className="header">
            <div className="container">
                <div className="row">
                    <div className="col-lg-4 my-auto">
                        <a href="/" className="logo">PhotoShowcase</a>
                    </div>
                    <div className="col-lg-4 my-auto text-center">
                        <div className="mainmenu">
                            <ul>
                                <li><Link getData={this.showData} to='/'>Home </Link></li>
                                 <li><Link to='/about'>About </Link></li>
                                <li><Link to="/disclaimer">Disclaimer</Link></li>
                            </ul>
                        </div>
                    </div>
                    <div className="col-lg-4 my-auto text-right">
                        <Search ondata={this.searchData} />
                      
                    </div>
                </div>
            </div>
        </header>
        );
    }
}

export default Header;
